import React from 'react'
// import classes from './Ads.module.css'
import logo from "../../assests/Logo.png";
export default function Ads() {
  return (
    <div> 
      <img src={logo} alt="ad" />
      <h1>This page will contain description of the ad</h1>
    </div>
  )
}
